def get_memory(memory):
    return ctypes.cast(memory, ctypes.py_object).value


def convert_to_memory(value):
    return id(value)


def convert_to_list(string):
    cache = ''
    data = []
    for i in string.replace(' ', ''):
        if i == ',':
            data.append(cache)
            cache = ''
        else:
            cache = f'{cache}{i}'
    data.append(cache)
    return data


def check(cache):
    length = 0
    for index, value in enumerate(cache):
        if value == '*':
            length += 1
    if length > len(cache) / 3 + 1:
        return False
    return True


